-- ----------------------------
-- Procedure structure for `UpdateCompanyValueByDay`
-- ----------------------------
DROP PROCEDURE IF EXISTS `UpdateCompanyValueByDay`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `UpdateCompanyValueByDay`()
BEGIN

declare wordcnt int default 0;
declare j int default 0;

declare  cnt  int default 0;
declare  i    int default 0;

declare v_boxCode varchar(100 ) default  '';
declare v_rate     varchar(100 )  default  '';
declare v_delimiter varchar(5 ) default  ',';

declare companyName     varchar(100 ) default  '';
declare refBoxCode      varchar(100 )  default  '';
declare companyCode      varchar(100 )  default  '';
declare companyValue    double default  0;
declare companyTime     datetime  default  null;

declare house1Value    double default  0;
declare house2Value    double default  0;
declare dateCenterValue    double default  0;


set cnt = 3;
while i < cnt
   do     set i = i + 1;

 select a.boxCode,a.rate into v_boxCode,v_rate  from companyinfo a where a.companyCode = concat('100',i );

/* SELECT v_boxCode,v_rate;*/

  /*call SumCompanyValue( v_boxCode,v_rate,"," );*/
set wordcnt = func_split_TotalLength(v_boxCode,v_delimiter);

DROP TABLE IF EXISTS `box_day_split`;
create temporary table `box_day_split` (`boxCode` varchar(128) not null  , `rate` varchar(128) not null   ,`value` double  null ) DEFAULT CHARSET=utf8;


while j < wordcnt
   do     set j = j + 1;
 end while;
set j = 0;

/*set result = 0;*/

DROP TABLE IF EXISTS `company_split_day_value`;
create temporary table `company_split_day_value` (`boxCode` varchar(128) not null  , `rate` varchar(128) not null   ,`value` double  null ,`ts` datetime  null ) DEFAULT CHARSET=utf8;


select  b.boxCode, b.rate,sum(b.rate*a.value) as s,a.ts from box_day_split b ,  boxminutepointvalue  a where  a.boxCode =  b.boxCode and TIMESTAMPDIFF(MINUTE,  a.ts,now())<=5 group by b.boxCode ;


 select  ROUND(sum(a.value),2), a.ts into companyValue,companyTime from company_split_day_value  a  ;

/*SELECT companyValue,companyTime;*/

select  b.name,b.companyCode,b.boxCode  into companyName ,companyCode,refBoxCode from companyinfo b where b.companyCode = concat('100',i );

    /* SELECT companyName;8*/


 end while;

select sum(a.value),a.ts into house1Value,companyTime  from boxminutepointvalue  a where  a.boxCode like '1%' and TIMESTAMPDIFF(MINUTE,  a.ts,now())<=5;
select  b.name,b.companyCode,b.boxCode  into companyName ,companyCode,refBoxCode from companyinfo b where b.companyCode = '2001';

select sum(a.value),a.ts into house2Value,companyTime  from boxminutepointvalue  a where  a.boxCode like '2%' and TIMESTAMPDIFF(MINUTE,  a.ts,now())<=5;
select  b.name,b.companyCode,b.boxCode  into companyName ,companyCode,refBoxCode from companyinfo b where b.companyCode = '2002';

set dateCenterValue = house1Value+house2Value;
select  b.name,b.companyCode,b.boxCode  into companyName ,companyCode,refBoxCode from companyinfo b where b.companyCode = '3000';
END
;;
DELIMITER ;

