select  b.name,b.companyCode,b.boxCode  into companyName ,companyCode,refBoxCode from companyinfo b where b.companyCode = concat('100',i );

    /* SELECT companyName;8*/


 end while;

/*select sum(value) from boxminutepointValue where  ts > ' 2013-05-11 11:38:00';*/
select sum(a.value),a.ts into house1Value,companyTime  from boxminutepointvalue  a where  a.boxCode like '1%' and TIMESTAMPDIFF(MINUTE,  a.ts,now())<=5;
